import React from 'react';
import Quiz from './Quiz';

const Home = ({ user }) => {
  return (
    <div>
      <h1>Welcome, {user.username}</h1>
      {user.region === 'Mumbai' ? (
        <Quiz username={user.username} />
      ) : (
        <p>Sorry, the quiz is only available for users from Mumbai.</p>
      )}
    </div>
  );
};

export default Home;
